import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { MapContainer, TileLayer, CircleMarker, Tooltip, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import '../css/todaydust.css';
import cityMapping from '../region_mapping/cityMapping.js';

const cityCoordinates = {
  서울: [37.5665, 126.9780],
  부산: [35.1796, 129.0756],
  대구: [35.8714, 128.6014],
  인천: [37.4563, 126.7052],
  광주: [35.1595, 126.8526],
  대전: [36.3504, 127.3845],
  울산: [35.5396, 129.3114],
  경기: [37.2636, 127.0286],
  강원: [37.8228, 128.1555],
  충북: [36.6355, 127.4913],
  충남: [36.5184, 126.8000],
  전북: [35.8200, 127.1088],
  전남: [34.8679, 126.9910],
  경북: [36.5752, 128.5056],
  경남: [35.4606, 128.2132],
  제주: [33.4996, 126.5312]
};

const TodayDust = () => {
  const [dustData, setDustData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(
          'https://apis.data.go.kr/B552584/ArpltnStatsSvc/getCtprvnMesureLIst?itemCode=PM10&dataGubun=HOUR&pageNo=1&numOfRows=1&returnType=json&serviceKey=zhvs5TlKznNkfpG91l4BPgIcZtbsxovufWhyA4%2Bw2KcaA1dp6RsGVOYHyD91i%2FXzDfAqOFIdScVjvbElsw%2BBCQ%3D%3D'
        );
        const data = await response.json();
        setDustData(data.response.body.items[0]);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  // 도시명과 미세먼지 농도를 추출
  const cities = Object.entries(dustData).filter(
    ([key]) => key !== 'dataTime' && key !== 'dataGubun' && key !== 'itemCode'
  );

  // 농도에 따라 원의 색상을 다르게 설정하는 함수
  const getColorByPM10 = (value) => {
    if (!value || value === '-') return 'gray'; // 데이터가 없을 때 회색
    const pmValue = parseFloat(value);
    if (pmValue <= 30) return 'green'; // 좋음
    if (pmValue <= 80) return 'yellow'; // 보통
    if (pmValue <= 150) return 'orange'; // 나쁨
    return 'red'; // 매우 나쁨
  };

  // 농도에 따라 원의 크기를 조절하는 함수
const getRadiusByPM10 = (value) => {
  if (!value || value === '-') return 10;
  const pmValue = parseFloat(value);
  return pmValue / 10 + 10; // 농도에 따라 마커 크기 조절
};



  return (
    <div className="dust-container">
      <header className="dust-header">
        <h1>TodayDust Page</h1>
      </header>

      <main className="dust-content">
        <p>오늘의 미세먼지 지도</p>

        {/* Leaflet 지도 */}
        <MapContainer center={[36.5, 128.5]} zoom={7} scrollWheelZoom={false} zoomControl={false} style={{ height: '500px', width: '100%' }}>
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          />



{cities.map(([city, value]) => {
  const coordinates = cityCoordinates[cityMapping[city]];
  if (!coordinates) return null;

  return (
    <CircleMarker
      key={city}
      center={coordinates}
      radius={15}
      color={getColorByPM10(value)}
      fillOpacity={0.7}
    >
      <Tooltip
        permanent
        direction="center"
        className="custom-tooltip"
      >
        <span style={{
          fontWeight: 'bold',
          color: 'black',
          fontSize: '12px'
        }}>
          {cityMapping[city]}
        </span>
      </Tooltip>
      <Popup>
        <div style={{ textAlign: 'center' }}>
          <strong>{cityMapping[city]}</strong> <br />
          미세먼지(PM10): {value}㎍/m³ <br />
          상태:
          {parseFloat(value) <= 30 ? '좋음' :
           parseFloat(value) <= 80 ? '보통' :
           parseFloat(value) <= 150 ? '나쁨' : '매우 나쁨'}
        </div>
      </Popup>
    </CircleMarker>
  );
})}
        </MapContainer>

        <p>측정일시: {dustData.dataTime}</p>

        <p>사용자 맞춤 분석</p>
        <Link to="/analyze">
          <button className="AI-button">AI 분석 페이지 이동</button>
        </Link>
      </main>

      <Link to="/main">
        <button className="main-button">Main</button>
      </Link>
    </div>
  );
};

export default TodayDust;
